DROP TABLE IF EXISTS "documentos";

CREATE TABLE "documentos" (
  id SERIAL PRIMARY KEY,
  id integer NULL,
  cliente_id integer NULL,
  fecha varchar(255),
  nro_fact varchar(36) NOT NULL,
  importe varchar(100) default NULL,
  cod_barras varchar(13) default NULL
);

;

